  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0155836 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise KNOX11RR in the
  Indian Ocean from 2007-11-07 to 2007-11-25. These data include CURRENT SPEED - EAST/WEST
  COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
  to collect these data include ADCP and GPS. These data were collected by Evelyn
  Fueri of University of California - San Diego; Scripps Institution of Oceanography
  as part of Study of volatile systematics of submarine basalts along the Central
  Indian Ridge and on La Reunion/Mauritius. The Lamont-Doherty Earth Observatory (LDEO)
  submitted these data to NCEI as part of the NSF sponsored Rolling Deck to Repository
  (R2R) program.nnThe ADCP data represent the raw and automated processed data set.
  Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
